import React from 'react';
import './App.css';
import Header from './components/Header'

function App() {
    return (
        <div className='app__container'>
           <Header />
           <div className='app__body'>
               <h2>New Collection</h2>
               <p>{`< `}<strong>1/12</strong>{` >`}</p>
           </div>
        </div>
    )
}
export default App;
